    /**
     * @var RoleRoleTag
     */
    private $roleRoleTag;
private $oldTag;
private $newTag;
    /**
     * @var \BristolSU\ControlDB\Contracts\Repositories\Tags\RoleTag
     */
    private $roleTag;

    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct(RoleRoleTag $roleRoleTag, \BristolSU\ControlDB\Contracts\Repositories\Tags\RoleTag $roleTag)
    {
        parent::__construct();
        $this->roleRoleTag = $roleRoleTag;
        $this->roleTag = $roleTag;
    }

    /**
     * Execute the console command.
     *
     * @return mixed
     * @throws Exception
     */
    public function handle()
    {
        $this->oldTag = $this->roleTag->getById(12);
        $this->newTag = $this->roleTag->getById(13);
        $count = 0;
        foreach($this->toChange as $details) {
            $roles = \BristolSU\ControlDB\Models\Role::where('group_id', $details['group_id'])
                ->where('position_id', $details['position_id'])->get();
            foreach($roles->filter(function(\BristolSU\ControlDB\Models\Role $role) use ($details) {
                return $role->data()->roleName() == $details['role_name'];
            }) as $role) {
                $users = $role->users()->filter(function(\BristolSU\ControlDB\Models\User $user) use ($details) {
                    return $user->dataProviderId() === $details['user_data_id'];
                });
                if($users->count() > 0) {
                    $this->roleRoleTag->removeTagFromRole($this->newTag, $role);
                    $this->roleRoleTag->addTagToRole($this->oldTag, $role);
                }
            }
        }
        $this->info($count);
    }

